import React from "react";
import "./Pages.css";

export default function Contact() {
  return (
    <section className="page contact-page">
      <h1>Contact Us</h1>
      <p>Email: info@akibatterymaterials.ca</p>
      <p>Phone: +1 (555) 123-4567</p>
      <p>Address: Southern Ontario, Canada</p>
    </section>
  );
}
